import logo from './images/header_image.png';
import './App.scss';

function App() {
    let cnt_hello = 0;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          柿崎愛斗のポートフォリオサイト
        </p>
        <button className = "hello_button" onClick = {count_hello}>こんにちは!</button>
        <p className = "hello_counter">{this.cnt_hello}</p>
      </header>
    </div>
  );
}

function count_hello(){
    cnt_hello += 1;
}

export default App;
